        height: '555px',
        background: 'linear-gradient(to bottom, #fce3df 0%, #ffffff 40%)',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        boxSizing: 'border-box',
      }}
    >
      {/* Frame6 content goes here */}
      <div style={{ color: '#1C264C', fontSize: '32px', fontWeight: 600 }}>Frame6 Placeholder</div>
    </div>
  );
};

export default Frame6;
